INSERT INTO `s_sql` VALUES ('117', '{\"db_name\":\"cms-platform-fame\",\"opt_time\":1522462374616,\"sql\":\"CREATE TABLE `b_msg_sys` (\\r\\n  `id` varchar(32) NOT NULL,\\r\\n  `account_sets` varchar(64) DEFAULT NULL COMMENT \'账套号\',\\r\\n  `create_time` datetime DEFAULT NULL COMMENT \'创建时间，默认当前时间\',\\r\\n  `from_userid` varchar(32) DEFAULT NULL COMMENT \'消息来自哪个用户，用户id\',\\r\\n  `from_username` varchar(128) DEFAULT NULL COMMENT \'消息来自哪个用户，用户真实姓名，冗余字段，便于获取用户姓名\',\\r\\n  `to_userid` varchar(32) DEFAULT NULL COMMENT \'消息接受用户，用户id\',\\r\\n  `to_userinfo` varchar(128) DEFAULT NULL COMMENT \'消息接受用户信息，用户真实姓名、手机号、email\',\\r\\n  `notice_way` varchar(32) DEFAULT NULL COMMENT \'提醒方式：各自的code:短信：sms；邮件：email；系统消息：sys_info\',\\r\\n  `msg_title` varchar(64) DEFAULT NULL COMMENT \'消息内容，模板提供消息标题\',\\r\\n  `msg_info` varchar(255) DEFAULT NULL COMMENT \'消息内容，根据模板拼接的消息内容\',\\r\\n  `msg_status` char(2) DEFAULT \'0\' COMMENT \'消息/待办的状态：0未处理  1已读/已处理 2已失效/已作废\',\\r\\n  `msg_flag` char(2) DEFAULT NULL COMMENT \'类型 1通知 2待办\',\\r\\n  `msg_type` char(2) DEFAULT NULL COMMENT \'消息按业务来源分类的类型 1新任务 2计划审查 3审查结果  4超期提醒\',\\r\\n  `deal_time` timestamp NULL DEFAULT NULL COMMENT \'根据业务场景代表不同的含义：阅读时间/处理时间/失效时间：处理结果\',\\r\\n  `reply` varchar(255) DEFAULT NULL COMMENT \'信息反馈信息\',\\r\\n  `url` varchar(255) DEFAULT NULL COMMENT \'办理地址,也就是跳转页面地址\',\\r\\n  PRIMARY KEY (`id`)\\r\\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'系统消息记录表\'\"}', null);
