INSERT INTO `s_sql` VALUES ('119', '{\"db_name\":\"cms-platform-fame\",\"opt_time\":1522462374782,\"sql\":\"CREATE TABLE `b_msg_template` (\\r\\n  `id` varchar(32) NOT NULL COMMENT \'主键\',\\r\\n  `account_sets` varchar(64) DEFAULT NULL COMMENT \'账套号\',\\r\\n  `msg_title` varchar(64) DEFAULT NULL COMMENT \'消息标题\',\\r\\n  `msg_info` varchar(800) DEFAULT NULL COMMENT \'消息内容：{sms:\'\'发送的短信\'\',email:\'\'发送的电子邮件\'\',sys_info:\'\'发送的系统消息\'\'}json形式，可扩展其他消息提醒方式，key为通知方式的键，value为通知的模板值\',\\r\\n  `msg_flag` char(2) DEFAULT NULL COMMENT \'类型 1通知 2待办\',\\r\\n  `msg_source` char(2) DEFAULT NULL COMMENT \'消息按业务来源分类的类型 1新任务 2计划审查 3审查结果  4超期提醒\',\\r\\n  `notice_type` varchar(12) DEFAULT NULL COMMENT \'通知类型：{sms:1,email:1,sys_info:1}json形式，可扩展其他消息提醒方式，其中0代表关，1代表开\',\\r\\n  `create_time` datetime DEFAULT NULL COMMENT \'添加时间\',\\r\\n  `operation` varchar(255) DEFAULT NULL COMMENT \'点击后操作\',\\r\\n  `disabled` char(1) DEFAULT NULL COMMENT \'是否禁用，0-未禁用，1-禁用\',\\r\\n  PRIMARY KEY (`id`)\\r\\n) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COMMENT=\'消息模板表\'\"}', null);
